import './App.css';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import NeuralChatAuth from './pages/login-signup';
import NeuralChatLanding from './pages/NeuralChatLanding';

function App() {
  return (  
    <Router>
      <Routes>
        <Route path="/" element={<NeuralChatLanding />} />
        <Route path="*" element={<Navigate to="/" />} />
        <Route path="/auth" element={<NeuralChatAuth />} />

      </Routes>
    </Router>
  );
}

export default App;
